import React from "react";
import "./Contact.css";

function Contact() {
    return (
        <section id="contact" class="contact-container">
            <div class="container">
                <h2>Contact</h2>
                <ul>
                    <li><i class="fas fa-envelope"></i> drxckpro123@gmail.com</li>
                </ul>
            </div>
        </section>
    );
}

export default Contact;
